import React from 'react';


const Home = () => {
    return (
        <div className="containerabout-page">
            <h1>Welcome to my portfolio</h1>
            <ul>in this website you can:</ul>
                <li>Check my Projects</li>
                <li>Read information about me</li>
        </div>
    );
};

export default Home;
